import React from 'react';
import logo from './logo.svg';
import './App.css';

import { BrowserRouter as Router } from 'react-router-dom';

import Routes from './Routes'

function App() {
  return (
    <Routes>
      <div className="App">
        <header className="App-header">
          <img src={logo} className="App-logo" alt="logo" />
          <p>
            Home
        </p>
          <a        >
            Routes
        </a>
        </header>
      </div>
    </Routes>
  );
}

export default App;
